import React from "react";
import Footer from "./Footer";
import {browselinks} from "../links";
import logo from "../icons/logo.svg";

function Browse(){
  return(
    <div className="page-container">
      <div className="browse-header">

        <nav className="navbar navbar-expand-sm navbar-dark">
          <img className="navbar-logo" src={logo} alt="Netflix logo"></img>
          <div className="links-dropdown">
          <button className="btn-dropdown" >Browse<i class="fas fa-sort-down"></i></button>
          </div>

          <div className="links-nav">
          <ul className="navbar-nav">
          {links.map(link => {
            return(
                <li className="nav-item active">
                  <a className="nav-link" href={link.link}>{link.title}</a>
                </li>
          )})}
          </ul>
        </div>
        </nav>
      </div>

      <div className="browse-top">

      </div>

      <div className="browse-body">

      </div>

      <div className="sigin-footer-wrapper">
        <Footer title={() => {}} pageLinks={browselinks}/>
      </div>
    </div>
  );
}

const links = [
  {
    title: "Home",
    link: "/browse"
  },
  {
    title: "TV Shows",
    link: "https://www.netflix.com/browse/genre/83"
  },
  {
    title: "Movies",
    link: "https://www.netflix.com/browse/genre/34399"
  },
  {
    title: "Latest",
    link: "https://www.netflix.com/latest"
  },
  {
    title: "My List",
    link: "https://www.netflix.com/browse/my-list"
  }
];

export default Browse;
